import { Card, List } from "antd";
import React from "react";

const AllPosts = ({post}) => {

    const posts = [];
    posts = post;

console.log("포스트", post);
    return(
        <>
        <List 
        grid={{
            gutter: 16,
            column: 4
        }}
        dataSource={post}
        renderItem={(item) => (
            <List.Item>
                <Card title={item.lookName}>

                </Card>
            </List.Item>
        )}
        />
        </>
    );

};

export default AllPosts;
